import { dashboard, expenses, transactions, trend } from "./icons";


export const menuItems = [
    {
        id: 1,
        title: 'Dashboard',
        icon: dashboard,
        link: '/dashboard'
    },
    {
        id: 2,
        title: "Incomes",
        icon: trend,
        link: "/dashboard",
    },
    {
        id: 3,
        title: "Expenses",
            icon: expenses,
        link: "/dashboard",
    },
]
